import React from "react";
import { Button, Checkbox, Icon } from "semantic-ui-react";
import { getSavedUsers, saveUser } from "api/db-init";

const Submit: React.FC = () => {
  return (
    <React.Fragment>
      <div>
        <Checkbox
          style={{ color: "magenta" }}
          toggle
          label="Password"
          onChange={() => saveUser("test")}
        />
      </div>
      <Button
        icon
        labelPosition="left"
        id="saveUser"
        size="medium"
        color="instagram"
        type="button"
        style={{
          display: "inline-block",
          margin: "10px auto 10px 5px",
        }}
        onClick={(e) => console.log(getSavedUsers())}
      >
        <Icon name="plus" />
        Save User
      </Button>
    </React.Fragment>
  );
};

export default Submit;
